import { Outlet, useNavigate } from 'react-router-dom';
import { useEffect } from 'react';


const Layout:React.FC = () => {
    const navigate = useNavigate();
    useEffect(() => {
      navigate('home');
    }, []);

  return (
    <div>Layout</div>
  )
}

export default Layout;
